import React from 'react'
import { withGoogleMap, GoogleMap, Marker } from 'react-google-maps';

function Map({center}) {
    return (
        <GoogleMap
            defaultZoom={13}
            defaultCenter={center}>
            
        </GoogleMap>
    )
}

export default Map
